        { name: 'Rocket Man', artist: 'Elton John', album: 'Honky Château', id: 1 },
        { name: 'Space Oddity', artist: 'David Bowie', album: 'Space Oddity', id: 2 }
    ]);

    const [toPlaylist, setToPlaylist] = useState([]);

    const onAdd3 = (tr) => {
        setToPlaylist(prev => [{ tr }, ...prev])
        console.log(toPlaylist);
    }

    return(
        <div className="SearchResult">
            <h2>Results</h2>
            <TrackList searchResults={searchResults} onAdd2={tr => onAdd3(tr)} />
        </div>
    )
}

export default SearchResult;
